import React, { Component } from 'react'

import NavBar from '../Containers/NavBar';

export class MessAppsBlog extends Component {
  render() {
    return (
      <div>
        <NavBar/>
        <h1>BlogPage</h1>
      </div>
    )
  }
}

export default MessAppsBlog
